import React, { Component } from "react";

export default class Clock extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  componentWillMount() {
    console.log("componentWillMount");
  }
  render() {
    console.log("render");
    return null;
  }
  componentDidMount() {
    console.log("componentDidMount");
  }
}
